 import React from 'react';
//import camp from '../image-asset/Camping.jpg';
import './Card-style.css';
 import CardHeader from '@material-ui/core/CardHeader';


const Card= props =>{
    return(
        <React.Fragment>
            <h1 className="text-capitalize text-center my-5 text-danger">POPULAR GROUPS</h1>

        <div className= "card-text-center">
            <div className= "overflow">
                <img src= {props.imgsrc} height="200"  width="300" alt= "Camping" className="card-img-top"/>
            </div>
            <div className="card-body text-dark">
            <h4 className="card-title">{props.title}</h4>
            <p className=" card-text-center"> Organized by Advent Park for happy and advent you </p>
            <p className= "md-form md-outline input-with-post-icon datepicker">{props.date}</p>
            <p className="md-form md-outline input-with-post-icon timepicker">{props.time} </p>
        </div>
         </div>
        </React.Fragment>

    );

}



export default Card;
